import { Form } from "react-bootstrap";

function InputDiv(){
    return(
        <div className="container-lg mx-auto bg-slate-800 flex justify-center">
            <form className="">
                <input className="placeholder:italic placeholder:text- text-black rounded-md h-10 p-2 w-100" type="text" required placeholder="todo"/>
                <button className="bg-slate-400 rounded-md h-10 p-2 ml-2">+ Todo</button>
            </form>
        </div>
    )
}
export default InputDiv;
